import Hotel from "../../model/hotels/hotels";
import Restaurant from "../../model/hotels/restaurants";
import { hotelSearchTransformer } from "../../utils/transformer/hotels";

/**
 * @method - post
 * @description - / create hotel
 */

const createHotel = async (req, res) => {
  const requestParam = req.body;
  const hotel = new Hotel({ ...requestParam, restaurants: [] });
  try {
    let hasHotel = await Hotel.findOne({
      propCode: requestParam.propCode,
    });
    if (!hasHotel) {
      await hotel.save();
      res.status(200).json({
        data: hotel,
        message: "Hotel added sucessfully !",
      });
    } else {
      res.status(400).json({
        data: [],
        message: "Hotel already exist!",
      });
    }
  } catch (err) {
    return res.status(500).json({
      data: null,
      message: "Internal server error !" + err,
    });
  }
};

/**
 * @method - post
 * @description - add Restaurant in hotel
 */

const addRestaurantInHotel = async (req, res) => {
  const requestParam = req.body;
  try {
    let hotel = await Hotel.findOne({
      propCode: requestParam.propCode,
    });
    if (hotel) {
      let restaurant = await Restaurant.findOne({
        _id: requestParam.restaurantId,
      });

      if (!restaurant) {
        return res.status(400).json({
          data: null,
          message: "restaurantId not exists!",
        });
      }
      let match = hotel.restaurants.find((e) =>
        e.equals(requestParam.restaurantId)
      );
      if (!match) {
        hotel.restaurants.push(requestParam.restaurantId);
        await hotel.save();
        res.status(200).json({
          data: hotel,
          message: "restaurant added sucessfully !",
        });
      } else {
        res.status(400).json({
          data: null,
          message: "restaurant already exist in this hotel !",
        });
      }
    } else {
      res.status(200).json({
        data: [],
        message: "Hotel not exist !",
      });
    }
  } catch (err) {
    return res.status(500).json({
      data: null,
      message: "Internal server error !" + err,
    });
  }
};

/**
 * @method - get
 * @description - list all hotels
 */

const listHotels = async (req, res) => {
  try {
    let hotels = await Hotel.find()
      .populate({
        path: "restaurants",
        model: "Restaurant",
        populate: {
          path: "meals",
          model: "Meal",
        },
      })
      .lean()
      .exec();
    if (hotels) {
      res.status(200).json({
        data: hotels,
      });
    } else {
      res.status(400).json({
        data: [],
        message: "not exist",
      });
    }
  } catch (err) {
    return res.status(500).json({
      data: null,
      message: "Internal server error !" + err,
    });
  }
};

/**
 * @method - get
 * @description - search hotels
 */

const searchHotels = async (req, res) => {
  try {
    let hotels = await Hotel.find();
    if (hotels) {
      var serachResult = hotelSearchTransformer(hotels);
      res.status(200).json({
        data: serachResult,
      });
    } else {
      res.status(400).json({
        data: [],
        message: "hotels not exist",
      });
    }
  } catch (err) {
    return res.status(500).json({
      data: null,
      message: "Internal server error !" + err,
    });
  }
};

export { createHotel, addRestaurantInHotel, listHotels, searchHotels };

